<node CREATED="1608646556975" ID="ID_1819081251" MODIFIED="1613048612666" TEXT="CREATE DATABASE IF NOT EXISTS bd_bob; &#xa;&#xa;USE bd_saae; &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo ( &#x9;id int PRIMARY KEY AUTO_INCREMENT,     placa varchar(20),     marca varchar(50),     modelo varchar(70),     ano int,     tipo varchar(30),     carroceria varchar(50),     configuracao int,     info varchar(150), combustivel int ); &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_documento( &#x9;id int PRIMARY KEY AUTO_INCREMENT,     n_registro varchar(50),     validade bigint,     info varchar(150) ); &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_documento( &#x9;id_veiculo int,     id_documento int,     FOREIGN KEY (id_veiculo) REFERENCES tb_veiculo (id),     FOREIGN KEY (id_documento) REFERENCES tb_documento(id) );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_usuario_tipo( &#x9;id INT PRIMARY KEY,     descricao VARCHAR(50) );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_usuario( &#x9;id INT AUTO_INCREMENT PRIMARY KEY,     nome VARCHAR(75),     id_tipo INT,     FOREIGN KEY (id_tipo) REFERENCES tb_usuario_tipo(id) );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_km( &#x9;id INT AUTO_INCREMENT PRIMARY KEY,     id_veiculo INT,     id_usuario INT,     valor INT,     datamili BIGINT,     FOREIGN KEY (id_veiculo) REFERENCES tb_veiculo (id),     FOREIGN KEY (id_usuario) REFERENCES tb_usuario (id)     );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_combustivel( &#x9; id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,      id_veiculo INT NOT NULL,      id_usuario INT NOT NULL,       km INT NOT NULL,      posto VARCHAR(100),      combustivel VARCHAR(50),      litros float,      valor float,      datamili BIGINT,      FOREIGN KEY (id_veiculo) REFERENCES tb_veiculo(id),      FOREIGN KEY (id_usuario) REFERENCES tb_usuario(id)  );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_item( &#x9; id INT AUTO_INCREMENT PRIMARY KEY,      tipo INT,      marca VARCHAR (150),      modelo VARCHAR (150),      valor float,      info VARCHAR(250)      );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_pedido( &#x9; id INT PRIMARY KEY AUTO_INCREMENT,      id_veiculo INT NOT NULL,      tipo INT,      km INT,      datamilis BIGINT,      info VARCHAR(250),      FOREIGN KEY (id_veiculo) REFERENCES tb_veiculo (id) );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_pedido_item( &#x9; id_pedido INT NOT NULL,      id_item INT NOT NULL,      valor float,      qtde float,      FOREIGN KEY (id_pedido) REFERENCES tb_pedido (id),      FOREIGN KEY (id_item) REFERENCES tb_item (id) );  &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_preventiva( &#x9; &#x9;id int PRIMARY KEY AUTO_INCREMENT,      &#x9;id_veiculo int NOT NULL,      &#x9;tipo int,    &#x9;&#x9; &#x9;km int, kmprox int,       &#x9;datamilis bigint,      &#x9;id_pedido int,      &#x9;info varchar(250),      &#x9;FOREIGN KEY (id_veiculo) REFERENCES tb_veiculo (id)   );&#x9;&#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_manutencao(&#xa;&#x9;id int PRIMARY KEY AUTO_INCREMENT,&#xa;    id_veiculo int,&#xa;    km int,&#xa;    valor float,&#xa;    datamilis bigint,&#xa;    oficina varchar (150),&#xa;    servico varchar (250),&#xa;    FOREIGN KEY (id_veiculo) REFERENCES tb_veiculo (id)&#xa;); &#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_pneu(&#xa;&#x9;id int PRIMARY KEY AUTO_INCREMENT,&#xa;    iditem int, &#xa;    fogo int,&#xa;    km int,&#xa;    kmtracao int,&#xa;    FOREIGN KEY (iditem) REFERENCES tb_item (id)&#xa;&#xa;);&#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_pneu( &#x9;&#xa;&#x9;idveiculo int NOT NULL,     &#xa;&#x9;idpneu int NOT NULL,     &#xa;&#x9;posicao int,     &#xa;&#x9;datamilis bigint,     &#xa;&#x9;FOREIGN KEY (idveiculo) REFERENCES tb_veiculo (id),     &#xa;&#x9;FOREIGN KEY (idpneu) REFERENCES tb_pneu (id)&#xa; );&#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_configuracao( &#x9;&#xa;&#x9;idveiculo int NOT NULL,     &#xa;&#x9;configuracao int,     &#xa;&#x9;nrodas int,     &#xa;&#x9;neixos int,     &#xa;&#x9;descricao varchar(50),     &#xa;&#x9;FOREIGN KEY (idveiculo) REFERENCES tb_veiculo(id) );&#xa;&#xa;CREATE TABLE IF NOT EXISTS tb_veiculo_configuracao_tracao( &#x9;&#xa; &#x9;idveiculo int NOT NULL,      &#x9;&#xa;&#x9;posicao int, &#x9;&#xa;&#x9;FOREIGN KEY (idveiculo) REFERENCES tb_veiculo(id) );&#xa;&#xa;&#xa;&#xa;"/>
</node>
</node>
